  return(
    <nav style={{marginBottom: 100}} className={'header-container'}>
      <ul className={'nav-list'}>
        <li>Copyright 2024</li>
        <li>Privacy</li>
        <li>Contact</li>
      </ul>
    </nav>
  )
}

